func And(predicates ...predicate.GoogleFlow) predicate.GoogleFlow {
	return predicate.GoogleFlow(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

