func Or(predicates ...predicate.GoogleFlow) predicate.GoogleFlow {
	return predicate.GoogleFlow(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

